import { useState, useEffect } from "react";
import { Navigate, useNavigate } from "react-router-dom";
import { BASE_URL } from "./constants";

const AuthPage = () => {
  const [isLogin, setIsLogin] = useState(true); // Toggle between login and register
  const [username, setUsername] = useState(""); // Username for login/register
  const [password, setPassword] = useState(""); // Password for login/register
  const navigate = useNavigate();
  const [error, setError] = useState("");

  useEffect(() => {
    const auth = localStorage.getItem("user");
    if (auth) {
      navigate("/");
    }
  });

  // Handle Login function
  const handleLogin = async () => {
    try {
      let result = await fetch(`${BASE_URL}/login`, {
        method: "post",
        body: JSON.stringify({ username, password }),
        headers: {
          "Content-Type": "application/json",
        },
      });

      if (result.ok) {
        const user = await result.json();
        localStorage.setItem("user", JSON.stringify(user));
        navigate("/");
      } else {
        const errorResponse = await result.json();
        setError(errorResponse.error || "Login failed");
      }
    } catch (error) {
      setError("An unexpected error occurred. Please try again later.");
    }
  };

  // Handle Register function
  const handleRegister = async () => {
    try {
      let result = await fetch(`${BASE_URL}/register`, {
        method: "post",
        body: JSON.stringify({ username, password }),
        headers: {
          "Content-Type": "application/json",
        },
      });

      const response = await result.json();
      if (response.error) {
        setError(response.error);
      } else {
        localStorage.setItem("user", JSON.stringify(response));
        setIsLogin(true);
      }
    } catch (error) {
      setError("Registration failed. Please try again.");
    }
  };

  return (
    <div className="flex justify-center items-center h-screen bg-red-50">
      <div className="w-[400px] p-8 bg-white rounded-lg shadow-lg border border-red-200">
        {/* Conditionally render Login or Register form */}
        {isLogin ? (
          <>
            {/* Login Form */}
            <h2 className="text-2xl font-semibold text-center mb-6 text-red-600">
              Login
            </h2>
            <input
              type="text"
              placeholder="Enter Username"
              className="w-full p-2 mb-4 border border-red-300 rounded focus:outline-none focus:ring-2 focus:ring-red-400"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
            />
            <input
              type="password"
              placeholder="Enter Password"
              className="w-full p-2 mb-4 border border-red-300 rounded focus:outline-none focus:ring-2 focus:ring-red-400"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
            {error && (
              <p className="text-red-500 text-sm mb-4">{error}</p>
            )}
            <button
              className="w-full bg-red-500 hover:bg-red-600 text-white py-2 rounded transition duration-200"
              onClick={handleLogin}
            >
              Login
            </button>
            <p className="text-center mt-4 text-gray-600">
              Don't have an account?{" "}
              <button
                className="text-red-500 underline"
                onClick={() => setIsLogin(false)}
              >
                Register here
              </button>
            </p>
          </>
        ) : (
          <>
            {/* Register Form */}
            <h2 className="text-2xl font-semibold text-center mb-6 text-red-600">
              Register
            </h2>
            <input
              type="text"
              placeholder="Enter Username"
              className="w-full p-2 mb-4 border border-red-300 rounded focus:outline-none focus:ring-2 focus:ring-red-400"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
            />
            <input
              type="password"
              placeholder="Enter Password"
              className="w-full p-2 mb-4 border border-red-300 rounded focus:outline-none focus:ring-2 focus:ring-red-400"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
            {error && (
              <p className="text-red-500 text-sm mb-4">{error}</p>
            )}
            <button
              className="w-full bg-red-500 hover:bg-red-600 text-white py-2 rounded transition duration-200"
              onClick={handleRegister}
            >
              Register
            </button>
            <p className="text-center mt-4 text-gray-600">
              Already have an account?{" "}
              <button
                className="text-red-500 underline"
                onClick={() => setIsLogin(true)}
              >
                Login here
              </button>
            </p>
          </>
        )}
      </div>
    </div>
  );
};

export default AuthPage;
